import React from 'react';
import { Link } from 'react-router-dom'; // Ensure you're using react-router-dom for navigation
import './App.css'; // Your CSS import
import './index.css';
import { BrowserRouter } from 'react-router-dom';

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);

function App() {
  return (
    <div className="min-h-screen flex flex-col bg-black">
      <header className="bg-gray-900 py-5">
        <div className="lg:max-w-6xl mx-auto px-4 sm:px-6 xl:px-0">
          <div className="sm:flex sm:items-center">
            <div className="flex sm:flex-none items-center justify-between">
              <Link to="/" aria-label="Homepage">
                {/* Adjust image paths as necessary */}
                <img className="h-10 sm:h-11 w-10 sm:w-11" src="/images/cryptocurrency-jobs-logo-darkmode.svg" alt="Cryptocurrency Jobs" />
              </Link>
              {/* Mobile nav toggle button here */}
            </div>
            {/* Navigation links */}
            <nav className="hidden sm:flex sm:flex-grow navbar-menu">
              {/* Your navigation links */}
            </nav>
          </div>
        </div>
      </header>



      {/* Search Bar */}
      <div className="flex-grow container mx-auto p-4">
        <div className="max-w-md mx-auto">
          <input type="text" className="w-full p-2 border border-gray-300 rounded mb-4" placeholder="Search jobs..." />
          <button className="w-full bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
            Search
          </button>
        </div>

        <h1 class="md:max-w-3xl text-4xl md:text-6xl lg:text-7xl text-white font-extrabold md:leading-tighter lg:leading-tighter tracking-tight mt-3">The leading job board for getting your shit fleeced cl</h1>
      </div>

      {/* Job Listings */}
      <div className="container mx-auto p-4">
        <h2 className="text-2xl font-bold mb-4">Latest Jobs</h2>
        {/* Job Card Example */}
        <div className="bg-white shadow-md rounded p-4 mb-6">
          <h3 className="font-bold">Frontend Developer</h3>
          <p className="text-sm">Location: Remote</p>
          <button className="mt-2 bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
            Apply Now
          </button>
        </div>
        {/* Repeat for each job */}
      </div>

      {/* Footer */}
      <footer className="bg-gray-200 text-center p-4">
        Â© 2024 Technology Talent Holdings (TTH), Inc.
      </footer>
    </div>
  );
}

export default App;
